import React from 'react'

import "./Head.css"

export function Head() {

  return (
    <nav className="head">
       <h1>Bioprep</h1>
        <ul className= "menu">
            <li><button className='btInicio'>Inicio</button></li>
            <li><button className='btInicio'>Productos</button></li>
            <li><button className='btInicio'>Nosotros</button>Nosotros</li>
            <li><button className='btInicio'>Inicio</button>Contacto</li>
            <br></br>
        </ul>
    </nav>
  );
}

export default Head;
